import React, {useState} from 'react';
import {AsyncTypeahead} from 'react-bootstrap-typeahead';

import './Typeahead.css';

const Typeahead = () => {
    const [loading, setLoading] = useState(false);

    return(
        <div className='async-typeahead-wrapper'>
            <AsyncTypeahead 
                isLoading={loading} 
                delay={250}
                id='async-typeahead'
                labelKey='search'
                maxResults={20}
                minLength={2}
                onInputChange={() => {}}
                onPaginate={() => {}}
                onSearch={() => {}}
                paginate
                placeholder="Search movies, tv sho...">
            </AsyncTypeahead>
        </div>
    );
}

export default Typeahead;
